import React, {Component} from 'react'
import { WingBlank, WhiteSpace } from 'antd-mobile';
import Entryitem from "../Entryitem";

class Categories extends Component{

    render() {
        return(
            <>

                    <Entryitem />
                    <Entryitem />
                    <Entryitem />
                    <Entryitem />
                    <Entryitem style={{ marginRight:0 }} />

            </>
        );
    }
}
export default Categories
